const NFLPlayer = ({ nflPlayer }) => {
  return (
    <div>
        <h3>{nflPlayer.Player}</h3>
        <p>{nflPlayer.Team}</p>
        <p>{nflPlayer.pos}</p>
        <p>{nflPlayer.att}</p>
    </div>
  )
}

export default NFLPlayer
